

def f(s,t):
    ls = len(s)
    lt = len(t)
    
    if ls == 0:
        return True

    if lt == 0 or ls > lt:
        return False

    a = [[0 for i in range(lt)] for j in range(ls)]

    for j in range(0, lt):
        if s[0] == t[j]:
            for k in range(j, lt):
                a[0][k] = True
            break

        else:
            a[0][j] = False
            
        
    for i in range(1, ls):
        for j in range(0, lt):
            if i > j:
                a[i][j] = False
                continue
            
            if a[i][j-1] == True or (a[i-1][j-1] == True and s[i] == t[j]):
                # a[i][j] = True
                for k in range(j, lt):
                    a[i][k] = True
                continue
            else:
                a[i][j] = False

    print(a)
    return a[ls-1][lt-1]

print(f('leeeeetcode', ''))

    
